import React, { useState } from "react";
import "./Faqs.css";
import { AiOutlinePlus } from "react-icons/ai";
import { FiX } from "react-icons/fi";
const Faqs = (question, answer, setAnswer, setQuestion) => {
  // const [question, setQuestion] = useState("");
  // const [answer, setAnswer] = useState("");
  const Qusetions = ({ question }) => <p>{question}!</p>;
  const Answers = ({ personName2 }) => <p>{personName2}!</p>;

  const [showResults, setShowResults] = useState(false);
  const [show, setShow] = useState(true);
  const [showResults2, setShowResults2] = useState(false);
  const [show2, setShow2] = useState(true);
  const [showResults3, setShowResults3] = useState(false);
  const [show3, setShow3] = useState(true);
  const [showResults4, setShowResults4] = useState(false);
  const [show4, setShow4] = useState(true);
  const [showResults5, setShowResults5] = useState(false);
  const [show5, setShow5] = useState(true);
  const [showResults6, setShowResults6] = useState(false);
  const [show6, setShow6] = useState(true);
  const [showResults7, setShowResults7] = useState(false);
  const [show7, setShow7] = useState(true);
  console.log(answer);
  const setQuestion1 = () => {
    setQuestion();
  };
  const setAnswer1 = () => {
    setAnswer();
  };
  console.log("question", question);
  console.log("set", setQuestion1);
  return (
    <div className="faqspage">
      <h1 className="frequently">Frequently Asked Questions</h1>
      <h6 className="feelFree">
        Feel free to send us your questions or comments below
      </h6>
      {/* Q1 and answer1 */}
      <div className="div1">
        <hr className="line" />
        <h2 className="Q1">
          <div>
            <Greeting personName={"Lorem Ipsum?"} />
          </div>
        </h2>
        {show ? (
          <AiOutlinePlus
            className="show"
            onClick={() => {
              setShowResults(true);
              setShow(!show);
              setQuestion1();
            }}
          />
        ) : (
          <FiX
            className="hide"
            onClick={() => {
              setShowResults(false);
              setShow(!show);
              setAnswer1();
            }}
          />
        )}

        {showResults ? (
          <div className="answer1">
            <hr className="line" />
            <p>
              <div>
                <Greeting
                  personName={
                    "Contrary to popular belief, Lorem Ipsum is not simply random text.It has roots in a piece of classical Latin literature from 45 BC,making it over 2000 years old. Richard McClintock, a Latin professor at Hampden-Sydney College in Virginia, looked up one ofthe more obscure Latin words, consectetur from a Lorem Ipsumpassage, and going through the cites of the word in classica literature"
                  }
                />
              </div>
            </p>
            <hr className="line3" />
          </div>
        ) : null}
      </div>
      {/* Q2 and answer2 */}
      {/* <div className="div2">
        <hr className="line" />
        <h2 className="Q2">{()=>setQuestion("Tempus magna risus interdum ultricies sed urna?")}</h2>
        {show ? (
          <AiOutlinePlus
            className="show2"
            onClick={() => {
              
              setShowResults(true);
              setShow(!show);
            }}
          />
        ) : (
          <FiX
            className="hide2"
            onClick={() => {
              setShowResults(false);
              setShow(!show);
            }}
          />
        )}

        {showResults ? (
          <div className="answer2">
            <hr className="line" />
            <p>
            {()=>setAnswer("Contrary to popular belief, Lorem Ipsum is not simply random text. It has roots in a piece of classical Latin literature from 45 BC, making it over 2000 years old. Richard McClintock, a Latin professor at Hampden-Sydney College in Virginia, looked up one of the more obscure Latin words, consectetur from a Lorem Ipsum passage, and going through the cites of the word in classical literature")}
            </p>
            <hr className="line3" />
          </div>
        ) : null}
      </div> */}
      {/* Q3 and answer3 */}
      <div className="div3">
        <hr className="line" />
        <h2 className="Q3">Augue in nibh urna volutpat mattis?</h2>
        {show3 ? (
          <AiOutlinePlus
            className="show3"
            onClick={() => {
              setShowResults3(true);
              setShow3(!show3);
            }}
          />
        ) : (
          <FiX
            className="hide3"
            onClick={() => {
              setShowResults3(false);
              setShow3(!show3);
            }}
          />
        )}
        {showResults3 ? (
          <div className="answer3">
            <hr className="line" />
            <p>
              Contrary to popular belief, Lorem Ipsum is not simply random text.
              It has roots in a piece of classical Latin literature from 45 BC,
              making it over 2000 years old. Richard McClintock, a Latin
              professor at Hampden-Sydney College in Virginia, looked up one of
              the more obscure Latin words, consectetur from a Lorem Ipsum
              passage, and going through the cites of the word in classical
              literature
            </p>
            <hr className="line3" />
          </div>
        ) : null}{" "}
      </div>
      {/* Q4 and answer4 */}
      <div className="div4">
        {" "}
        <hr className="line" />
        <h2 className="Q4">Eu egestas sed sed posuere ultrices ?</h2>
        {show4 ? (
          <AiOutlinePlus
            className="show4"
            onClick={() => {
              setShowResults4(true);
              setShow4(!show4);
            }}
          />
        ) : (
          <FiX
            className="hide4"
            onClick={() => {
              setShowResults4(false);
              setShow4(!show4);
            }}
          />
        )}
        {showResults4 ? (
          <div className="answer4">
            <hr className="line" />
            <p>
              Contrary to popular belief, Lorem Ipsum is not simply random text.
              It has roots in a piece of classical Latin literature from 45 BC,
              making it over 2000 years old. Richard McClintock, a Latin
              professor at Hampden-Sydney College in Virginia, looked up one of
              the more obscure Latin words, consectetur from a Lorem Ipsum
              passage, and going through the cites of the word in classical
              literature
            </p>
